import "../styles/Header.css";
import { RxCaretDown } from "react-icons/rx";

const Header = () => {
  return (
    <div className={`head-container`}>
      <div className={`logo head1`}></div>
      <div className={`title head`}>ATL Brew</div>
      {/* <div className={`head-divider divide1`}></div> */}
      <div className={`browse head `}>
        {" "}
        <div className={`button ghost-button`}>Browse </div>
      </div>
      <div className={`top-ten head `}>
        <div className={`button filled-button`}>Top Picks</div>
      </div>
      {/* <div className={`head-divider divide2`}></div> */}
      <div className={`sign-up head`}>
        <div className={`button ghost-button2`}>Sign Up</div>
      </div>
      <div className={`sign-in head`}>
        <div className={`button filled-button2`}>Sign In</div>
      </div>
      <div className={`nav-icon-container`}></div>
    </div>
  );
};

export default Header;
